		"615": "deus meus impolluta via ejus eloquia domini igne examinata protector est omnium sperantium in se alleluia alleluia ℣ diligam te domine fortitudo mea dominus firmamentum meum et refugium meum et liberator meus gloria patri",
		"619": "cognovi domine quia æquitas judicia tua et in veritate tua humiliasti me confige timore tuo carnes meas a mandatis tuis non me repellas alleluia alleluia ℣ beati immaculati in via qui ambulant in lege domini gloria patri",
		"622": "gaudens gaudebo in domino et exsultabit anima mea in deo meo quia induit me vestimentis salutis et indumento justitiæ circumdedit me quasi sponsam ornatam monilibus suis ℣ exaltabo te domine quoniam suscepisti me nec delectasti inimicos meos super me gloria patri",
		"624": "gaudeamus omnes in domino diem festum celebrantes sub honore beatæ mariæ virginis boni consilii matris de cujus solemnitate gaudent angeli et collaudant filium dei alleluia alleluia ℣ eructavit cor meum verbum bonum dico ego opera mea regi gloria patri",
		"629": "dilexisti justitiam et odisti iniquitatem propterea unxit te deus deus tuus oleo lætitiæ præ consortibus tuis alleluia alleluia ℣ eructavit cor meum verbum bonum dico ego opera mea regi gloria patri",
		"636": "spiritus domini replevit orbem terrarum et hoc quod continet omnia scientiam habet vocis ℣ exsurgat deus et dissipentur inimici ejus et fugiant qui oderunt eum a facie ejus gloria patri",
