		"653": "lætare jerusalem et conventum facite omnes qui diligitis eam gaudete cum lætitia qui in tristitia fuistis ut exsultetis et satiemini ab uberibus consolationis vestræ ℣ lætatus sum in his quæ dicta sunt mihi in domum domini ibimus gloria patri",
