		"692": "aperite mihi portas justitiæ ingressus in eas confitebor domino lapidem quem reprobaverunt ædificantes hic factus est in caput anguli alleluia alleluia ℣ confitemini domino quoniam bonus quoniam in sæculum misericordia ejus gloria patri",
		"693": "dominus secus mare galilææ vidit duos fratres petrum et andream et vocavit eos venite post me faciam vos fieri piscatores hominum ℣ cæli enarrant gloriam dei et opera manuum ejus annuntiat firmamentum gloria patri",
