		"733": "fac mecum domine signum in bonum ut videant qui me oderunt et confundantur quoniam tu domine adjuvisti me et consolatus es me ℣ inclina domine aurem tuam et exaudi me quoniam inops et pauper sum ego gloria patri",
		"735": "dicit dominus ego cogito cogitationes pacis et non afflictionis invocabitis me et ego exaudiam vos et reducam captivitatem vestram de cunctis locis ℣ benedixisti domine terram tuam avertisti captivitatem jacob gloria patri",
		"737": "salus autem justorum a domino et protector eorum est in tempore tribulationis ℣ noli æmulari in malignantibus neque zelaveris facientes iniquitatem gloria patri",
