		"775": "christo confixus sum cruci vivo autem jam non ego vivit vero in me christus in fide vivo filii dei qui dilexit me et tradidit semetipsum pro me alleluia alleluia ℣ beatus qui intelligit super egenum et pauperem in die mala liberabit eum dominus gloria patri",
		"776": "sitientes venite ad aquas dicit dominus et qui non habetis pretium venite bibite cum lætitia ℣ attendite popule meus legem meam inclinate aurem vestram in verba oris mei gloria patri",
