		"822": "deus dum egredereris coram populo tuo alleluia iter faciens eis alleluia habitans in illis alleluia alleluia ℣ exsurgat deus et dissipentur inimici ejus et fugiant qui oderunt eum a facie ejus gloria patri",
		"826": "congregate illi sanctos ejus qui ordinaverunt testamentum ejus super sacrificia et annuntiabunt cæli justitiam ejus quia deus tuus ego sum ℣ deus deorum dominus locutus est et vocavit terram gloria patri",
