		"831": "narraverunt mihi iniqui fabulationes sed non ut lex tua ego autem loquebar de testimoniis tuis in conspectu regum et non confundebar alleluia alleluia ℣ beati immaculati in via qui ambulant in lege domini gloria patri",
		"839": "in deo laudabo verbum in domino laudabo sermonem in deo speravi non timebo quid faciat mihi homo ℣ miserere mei deus quoniam conculcavit me homo tota die impugnans tribulavit me gloria patri",
		"849": "mihi autem absit gloriari nisi in cruce domini nostri jesu christi per quem mihi mundus crucifixus est et ego mundo ℣ voce mea ad dominum clamavi voce mea ad dominum deprecatus sum gloria patri",
