		"1054": "liberator meus de gentibus iracundis ab insurgentibus in me exaltabis me a viro iniquo eripies me domine ℣ diligam te domine fortitudo mea dominus firmamentum meum et refugium meum et liberator meus liberator",
		"1056": "omnia quæ fecisti nobis domine in vero judicio fecisti quia peccavimus tibi et mandatis tuis non obedivimus sed da gloriam nomini tuo et fac nobiscum secundum multitudinem misericordiæ tuæ ℣ beati immaculati in via qui ambulant in lege domini gloria patri",
