		"1278": "accipite jucunditatem gloriæ vestræ alleluia gratias agentes deo alleluia qui vos ad cælestia regna vocavit alleluia alleluia alleluia ℣ attendite popule meus legem meam inclinate aurem vestram in verba oris mei gloria patri",
