		"1294": "reminiscere miserationum tuarum domine et misericordiæ tuæ quæ a sæculo sunt ne unquam dominentur nobis inimici nostri libera nos deus israel ex omnibus angustiis nostris ℣ ad te domine levavi animam meam deus meus in te confido non erubescam gloria patri",
