		"1314": "redime me domine et miserere mei pes enim meus stetit in via recta in ecclesiis benedicam dominum ℣ judica me domine quoniam ego in innocentia mea ingressus sum et in domino sperans non infirmabor gloria patri",
		"1315": "introduxit vos dominus in terram fluentem lac et mel alleluia et ut lex domini semper sit in ore vestro alleluia alleluia ℣ confitemini domino et invocate nomen ejus annuntiate inter gentes opera ejus gloria patri",
