		"244": "invocavit altissimum potentem in oppugnando inimicos undique et audivit illum magnus et sanctus deus",
		"245": "eripe me de inimicis meis deus meus et ab insurgentibus in me libera me domine",
		"265": "perfice gressus meos in semitis tuis ut non moveantur vestigia mea inclina aurem tuam et exaudi verba mea mirifica misericordias tuas qui salvos facis sperantes in te domine",
		"269": "cognoscetur dominus ab ægypto et cognoscent ægyptii dominum in die illa et colent eum in hostiis et in muneribus et vota vovebunt domino et solvent",
		"280": "felix namque es sacra virgo maria et omni laude dignissima quia ex te ortus est sol justitiæ christus deus noster",
		"285": "non enim judicavi me scire aliquid inter vos nisi jesum christum et hunc crucifixum alleluia",
		"290": "confortamini et jam nolite timere ecce enim deus noster retribuet judicium ipse veniet et salvos nos faciet",
