		"320": "calix benedictionis cui benedicimus nonne communicatio sanguinis christi est et panis quem frangimus nonne participatio corporis domini est",
		"325": "precatus est moyses in conspectu domini dei sui et dixit quare domine irasceris in populo tuo parce iræ animæ tuæ memento abraham isaac et jacob quibus jurasti dare terram fluentem lac et mel et placatus factus est dominus de malignitate quam dixit facere populo suo",
		"328": "salvum me fac deus quoniam intraverunt aquæ usque ad animam meam",
