		"426": "insurrexerunt in me viri iniqui absque misericordia quæsierunt me interficere et non pepercerunt in faciem meam spuere lanceis suis vulneraverunt me et concussa sunt omnia ossa mea",
		"427": "post partum virgo inviolata permansisti dei genitrix intercede pro nobis",
		"436": "gaudeo in passionibus et adimpleo ea quæ desunt passionum christi in carne mea pro corpore ejus quod est ecclesia cujus factus sum ego minister alleluia",
		"448": "dextera domini fecit virtutem dextera domini exaltavit me non moriar sed vivam et narrabo opera domini alleluia",
