		"607": "ego autem cum mihi molesti essent induebar cilicio humiliabam in jejunio animam meam et oratio mea in sinu meo convertetur",
		"616": "si ambulavero in medio tribulationis vivificabis me domine et super iram inimicorum meorum extendes manum tuam et salvum me fecit dextera tua",
