		"3968": "jesu dulcis memoria dans vera cordis gaudia sed super mel et omnia ejus dulcis præsentia nil canitur suavius nil auditur jucundius nil cogitatur dulcius quam jesus dei filius jesu spes pœnitentibus quam pius es petentibus quam bonus te quærentibus sed quid invenientibus nec lingua valet dicere nec littera exprimere expertus potest credere quid sit jesum diligere sis jesu nostrum gaudium qui es futurus præmium sit nostra in te gloria per cuncta semper sæcula amen",
		"3988": "auctor beate sæculi christe redemptor omnium lumen patris de lumine deusque verus de deo amor coegit te tuus mortale corpus sumere ut novus adam redderes quod vetus abstulerat amor almus artifex terræ et siderum errata patrum miserans et nostra rumpens vincula non corde discedat tuo vis amoris inclyti hoc fonte gentes hauriant remissionis gratiam ad hoc est lancea ad hoc est vulnera ut nos lavaret sordibus unda et sanguine jesu tibi sit gloria qui corde fundis gratiam cum et almo spiritu in sempiterna sæcula amen",
