		"4044": "cælitum joseph decus atque nostræ certa spes vitæ columenque mundi quas tibi læti canimus benignus suscipe laudes te sator rerum statuit pudicæ virginis sponsum voluitque verbi te patrem dici dedit et ministrum esse salutis tu redemptorem stabulo jacentem quem chorus vatum cecinit futurum aspicis gaudens humilisque natum numen adoras rex deus regum dominator orbis cujus ad nutum tremit inferorum turba cui pronus famulatur æther se tibi subdit laus sit excelsæ triadi perennis quæ tibi præbens superos honores det tuis nobis meritis beatæ gaudia vitæ amen",
		"4073": "o quam glorifica luce coruscas stirpis davidicæ regia proles sublimis residens virgo maria supra cæligenas ætheris omnes tu cum virgineo mater honore domino pectoris aulam sacris visceribus casta parasti natus hinc deus est corpore christus quem cunctus venerans orbis adorat cui nunc rite genu flectitur omne a quo te petimus subveniente abjectis tenebris gaudia lucis hoc largire pater luminis omnis natum per proprium flamine sacro qui tecum nitida vivit in æthra regnans ac moderans sæcula cuncta amen",
		"7424": "conditor alme siderum æterna lux credentium christe redemptor omnium exaudi preces supplicum qui condolens interitu mortis perire sæculum salvasti mundum languidum donans reis remedium vergente mundi vespere uti sponsus de thalamo egressus honestissima virginis matris clausula cujus forti potentiæ genu curvantur omnia cælestia terrestria nutu fatentur subdita te deprecamur hagie venture judex sæculi conserva nos in tempore hostis a telo perfidi laus honor virtus gloria deo patri et filio sancto simul paraclito in sæculorum sæcula amen",
		"7426": "veni veni emmanuel captivum solve israel qui gemit in exsilio privatus dei filio gaude gaude emmanuel nascetur pro te israel veni veni rex gentium veni redemptor omnium ut salves tuos famulos peccati sibi conscios gaude gaude emmanuel nascetur pro te israel veni veni o oriens solare nos adveniens noctis depelle nebulas dirasque noctis tenebras gaude gaude emmanuel nascetur pro te israel veni clavis davidica regna reclude cælica fac iter tutum superum et claude vias inferum gaude gaude emmanuel nascetur pro te israel veni o jesse virgula ex hostis tuos ungula de specu tuos tartari educ et antro barathri gaude gaude emmanuel nascetur pro te israel veni veni adonai qui populo in sinai legem dedisti vertice in majestate gloriæ gaude gaude emmanuel nascetur pro te israel veni o sapientia quæ hic disponis omnia veni viam prudentiæ ut doceas et gloriæ gaude gaude emmanuel nascetur pro te israel",
		"8129": "cor arca legem continens non servitutis veteris sed gratiæ sed veniæ sed et misericordiæ cor sanctuarium novi intemeratum fœderis templum vetusto sanctius velumque utilius te vulneratum caritas ictu patenti voluit amoris invisibilis ut veneremur vulnera hoc sub amoris symbolo passus et mystica utrumque sacrificium christus sacerdos obtulit quis non amantem redamet quis non redemptus diligat et caritate jugiter hærere christo gestiat jesu tibi sit gloria qui corde fundis gratiam cum et almo spiritu in sempiterna sæcula amen",
		"9733": "ave maris stella dei mater alma atque semper virgo felix cæli porta sumens illud ave gabrielis ore funda nos in pace mutans hevæ nomen solve vincla reis profer lumen cæcis mala nostra pelle bona cuncta posce monstra esse matrem sumat per te preces qui pro nobis natus tulit esse tuus virgo singularis inter omnes mitis nos culpis solutos mites fac et castos vitam præsta puram iter para tutum ut videntes jesum semper collætemur sit laus deo patri summo christo decus spiritui sancto tribus honor unus amen",
		"10200": "vexilla regis prodeunt fulget crucis mysterium quo carne carnis conditor suspensus est patibulo quo vulneratus insuper mucrone diro lanceæ ut nos lavaret crimine manavit et sanguine impleta sunt quæ concinit david fideli carmine dicens in nationibus regnavit a ligno deus arbor et fulgida ornata regis purpura electa digno stipite tam sancta membra tangere beata cujus brachiis sæcli pependit pretium statera facta corporis prædamque tulit tartari o crux ave spes unica in hoc paschali gaudio auge piis justitiam reisque dona veniam te summa deus trinitas collaudet omnis spiritus quos per crucis mysterium salvas rege per sæcula amen",
